function main() {
    return new Promise(async (resolve, reject) => {
        try {
            console.log('Add sections');

            let conn = await dbService.conn();

            let keys = Object.keys(me_sections);

            for (let i = 0; i < keys.length; i++) {
                let key = keys[i];

                let data = me_sections[key];

                let check = await conn('me_sections').where('section_key', data.key).first();

                let active = typeof data.active !== 'undefined' ? data.active : true;

                if (!check) {
                    await conn('me_sections').insert({
                        token: data.token,
                        section_key: data.key,
                        section_name: data.name,
                        icon: data.icon,
                        position: i,
                        active,
                        created: timeNow(),
                        updated: timeNow(),
                    });
                } else {
                    await conn('me_sections').where('id', check.id).update({
                        token: data.token,
                        section_key: data.key,
                        section_name: data.name,
                        icon: data.icon,
                        position: i,
                        active,
                        updated: timeNow(),
                    });
                }
            }

            await deleteKeys(cacheService.keys.sections);

            resolve();
        } catch (e) {
            console.error(e);
        }

        resolve();
    });
}

module.exports = {
    main: main,
};

if (require.main === module) {
    (async function () {
        try {
            await main();
            process.exit();
        } catch (e) {
            console.error(e);
        }
    })();
}
